const products = [
  {
    id: 1,
    name: "Apple",
    description: "An Apple",
    category: "fruit",
    price:'70',
  },
  {
    id: 2,
    name: "bannana",
    description: "A bannana",
    category: "fruit",
  },
  {
    id: 3,
    name: "Orange",
    description: "An Orange",
    category: "fruit",
  },
];
module.exports = products;
